import React, { Component } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Profile from "../Profile/Profile";
import Skills from "../Profile/Skills";
import StackProgress from "../Profile/StackProgress";
import Education from "../Profile/Education";
import Achievements from "../Profile/Achievements";
import MyStuff from "../MyStuff/MyStuff";
import Experience from "../Profile/Experience";
import Projects2 from "../Projects/Projects2";
import { Nav, Navbar } from "react-bootstrap";

class Header extends Component {
  render() {
    if (this.props.projectData) {
      var name = this.props.projectData.name;
      this.titles = this.props.projectData.projects.titles.map((title) => [
        title.toUpperCase(),
        1500,
      ]);
    }

    const HeaderTitleTypeAnimation = React.memo(() => {
      return (
        <>
          {this.titles.map(([title, duration]) => (
            <span
              className="title-container__title"
              key={title}
              style={{ transitionDuration: duration + "ms" }}
            >
              {title}
            </span>
          ))}
        </>
      );
    });

    return (
      <Router>
        <Navbar>
          <Nav
            activeKey="/home"
            fill
            style={{ position: "absolute", top: 10, right: 10 }}
          >
            <Nav.Item>
              <Nav.Link href="/profile">Profile</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="/projects">Projects</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="/mystuff">MyStuff</Nav.Link>
            </Nav.Item>
          </Nav>
          <div className="row aligner" style={{ height: "100%" }}>
            <div className="col-md-12">
              <div>
                <span
                  className="iconify header-icon"
                  data-icon="la:laptop-code"
                  data-inline="false"
                ></span>
                <br />
                <h1 className="mb-0">{name}</h1>
                <div className="title-container">
                  <HeaderTitleTypeAnimation />
                </div>
              </div>
            </div>
          </div>
        </Navbar>
        <Routes>
          <Route path="/profile" element={<Profile />} />
          <Route
            path="/projects"
            element={
              <Projects2
                profileData={this.props.profileData}
                projectData={this.props.projectData.projects}
              />
            }
          />
          <Route path="/mystuff" element={<MyStuff />} />
          <Route path="/profile/skills" element={<Skills />} />
          <Route path="/profile/stackprogress" element={<StackProgress />} />
          <Route path="/profile/education" element={<Education />} />
          <Route path="/profile/experience" element={<Experience />} />
          <Route path="/profile/achievements" element={<Achievements />} />
        </Routes>
      </Router>
    );
  }
}

export default Header;
